import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Click on the first product card to open the detail modal
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.locator('.product-card').first().click();

    // 2. Wait for the product detail modal to be visible
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // 3. Click the "Add to Wish List" button
    await page.waitForSelector('.add-to-wishlist', { timeout: 5000 });
    await page.locator('.add-to-wishlist').click();

    // 4. Wait for the success notification and extract its text
    await page.waitForSelector('.notification.success', { state: 'visible', timeout: 5000 });
    const notificationText = await page.locator('.notification.success').textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_confirmation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_confirmation.png'));

    return {
      success: true,
      action: "Added a product to the wishlist and verified the confirmation message.",
      extractedData: {
        confirmationMessage: notificationText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));
    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
